import React, {useEffect, useState} from "react";
import "../../../src/css/header.css"

export default function Order() {
    const [order, setOrders] = useState([]);
    const [id, setId] = useState(0);

    const orders = () => {
        fetch("/order/get")
            .then(orders => orders.json())
            .then(orders => setOrders(orders))
    }

    const deleteById = (idElement) => {
        fetch("/order/deleteBy/id", {
            method: "DELETE",
            body: JSON.stringify({
                orderId: idElement
            }),
            headers: {
                "Content-Type": "application/json", charset: "UTF-8"
            }
        })
            .then(orders => console.log(orders.json()))
    }

    useEffect(() => {
        orders()
    })

    return (
        <>
            <div className="order">
                <table>
                    <tr>
                        <th>ID</th>
                        <th>NAME</th>
                        <th>PHONE</th>
                        <th>DELETED</th>
                    </tr>
                    {
                        order.map((o) => (
                            <tr>
                                <td className="id_order" key={o.id}>{o.id}</td>
                                <td key={o.name}>{o.name}</td>
                                <td key={o.numberPhone}>{o.numberPhone}</td>
                                <td>
                                    <button onClick={() => {
                                        deleteById(o.id)
                                    }}>Delete
                                    </button>
                                </td>
                            </tr>
                        ))
                    }
                </table>
            </div>
        </>
    )
}
